import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav style={styles.navbar}>
      <h2 style={styles.logo}>Auction App</h2>
      <div style={styles.links}>
        <Link to="/" style={styles.link}>Home</Link>
        <Link to="/dashboard" style={styles.link}>Dashboard</Link>
        <Link to="/post-auction" style={styles.link}>Post Auction</Link>
        <Link to="/signin" style={styles.button}>Sign In</Link>
        <Link to="/signup" style={styles.button}>Sign Up</Link>
      </div>
    </nav>
  );
};

const styles = {
  navbar: { display: "flex", justifyContent: "space-between", padding: "10px 20px", background: "#fff", borderBottom: "2px solid #ddd" },
  logo: { fontSize: "22px", fontWeight: "bold" },
  links: { display: "flex", alignItems: "center", gap: "15px" },
  link: { textDecoration: "none", color: "#333", fontSize: "16px" },
  button: { padding: "8px 12px", background: "#007bff", color: "#fff", borderRadius: "5px", textDecoration: "none" },
};

export default Navbar;
